import React from "react";
import styled from "styled-components";
import ItemCategoryCheckboxes from "./FilterSections/ItemCategoryCheckboxes";

export default function Filter({
  itemCategoryData,
  setItemCategoryData,
  itemCategoryCheckedData,
}) {
  return (
    <PageWrapper>
      <div>
        <h2>Filters</h2>
        <h1>General Filters</h1>
        <h1>Item Category Filters</h1>
        <ItemCategoryCheckboxes
          itemCategoryData={itemCategoryData}
          setItemCategoryData={setItemCategoryData}
          itemCategoryCheckedData={itemCategoryCheckedData}
        />
      </div>
    </PageWrapper>
  );
}

const PageWrapper = styled.nav`
  display: flex;
  flex-direction: column;
  border: 5px solid black;
`;
